import React from 'react';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Card from './CardTextos';


export default function Body(){
    return (
        <div>
            <Row>
            <Col><Card /></Col>
            </Row>
        </div>
    )

}
